<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Pathogenesis and treatment of thrombohemorrhagic diathesis in acute promyelocytic leukemia . Acute promyelocytic leukemia ( APL ) is a distinct subtype of myeloid leukemia characterized by t ( 15 ; 17 ) chromosomal translocation , which involves the retinoic acid receptor-alpha ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10276
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . APL typically presents with a life-threatening hemorrhagic diathesis . Before the introduction of all-trans retinoic acid ( DB00755 ) for the cure of APL , fatal hemorrhages due , at least in part , to the APL-associated coagulopathy , were a major cause of induction remission failure . The laboratory abnormalities of blood coagulation found in these patients indicate the occurrence of a hypercoagulable state . Major determinants of the coagulopathy of APL are endogenous factors expressed by the leukemic cells , including procoagulant factors , fibrinolytic proteins , and non-specific proteolytic enzymes . In addition , these cells have an increased capacity to adhere to the vascular endothelium , and to secrete inflammatory cytokines [ i . e . interleukin - 1beta ( IL - 1beta ) and tumor necrosis factor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) ] , which in turn stimulate the expression of prothrombotic activities by endothelial cells and leukocytes . DB00755 can interfere with each of the principal hemostatic properties of the leukemic cell , thus reducing the APL cell procoagulant potential , in parallel to the induction of cellular differentiation . This effect occurs in vivo , in the bone marrow of APL patients receiving DB00755 , and is associated with the improvement of the bleeding symptoms . Therapy with arsenic trioxide ( ATO ) also beneficially affects coagulation in APL . However , early deaths from bleeding still remain a major problem in APL and further research is required in this field . In this review , we will summarize our current knowledge of the pathogenesis of the APL-associated coagulopathy and will overview the therapeutic approaches for the management of this complication .</div>

 Intraparenchymal Study Group . PURPOSE : Glioblastoma multiforme ( GBM ) is a devastating brain tumor with a median survival of 6 months after recurrence . Cintredekin besudotox ( CB ) is a recombinant protein consisting of interleukin - 13 (

 ) and a truncated form of Pseudomonas exotoxin ( PE38QQR ) . Convection-enhanced delivery ( DB01333 ) is a locoregional-administration method leading to high-tissue concentrations with large volume of distributions . We assessed the use of intracerebral DB01333 to deliver CB in patients with recurrent malignant glioma ( MG ) . PATIENTS AND METHODS : Three phase I clinical studies evaluated intracerebral DB01333 of CB along with tumor resection . The main objectives were to assess the tolerability of various concentrations and infusion durations ; tissue distribution ; and methods for optimizing delivery . All patients underwent tumor resection followed by a single intraparenchymal infusion ( in addition to the intraparenchymal one following resection ) , with a portion of patients who had a preresection intratumoral infusion . RESULTS : A total of 51 patients with MG were treated including 46 patients with GBM . The maximum tolerated intraparenchymal concentration was 0.5 microg / mL and tumor necrosis was observed at this concentration . Infusion durations of up to 6 days were well tolerated . Postoperative catheter placement appears to be important for optimal drug distribution . CB - and procedure-related adverse events were primarily limited to the CNS . Overall median survival for GBM patients is 42.7 weeks and 55.6 weeks for patients with optimally positioned catheters with patient follow-up extending beyond 5 years . CONCLUSION : CB appears to have a favorable risk-benefit profile . DB01333 is a complex delivery method requiring catheter placement via a second procedure to achieve accurate catheter positioning , better drug distribution , and better outcome .</div>

 ) involves aberrant airway inflammatory responses to cigarette smoke ( CS ) that are associated with epithelial cell dysfunction , cilia shortening , and mucociliary clearance disruption . Exposure to CS reduced cilia length and induced autophagy in vivo and in differentiated mouse tracheal epithelial cells ( MTECs ) . Autophagy-impaired ( Becn 1 + / - or Map 1lc3B - / - ) mice and MTECs resisted CS-induced cilia shortening . Furthermore , CS increased the autophagic turnover of ciliary proteins , indicating that autophagy may regulate cilia homeostasis . We identified cytosolic deacetylase Q9UBN7 as a critical regulator of autophagy-mediated cilia shortening during CS exposure . Mice bearing an X chromosome deletion of Hdac 6 ( Hdac 6 - / Y ) and MTECs from these mice had reduced autophagy and were protected from CS-induced cilia shortening . Autophagy-impaired Becn 1 - / - , Map 1lc3B - / - , and Hdac 6 - / Y mice or mice injected with an Q9UBN7 inhibitor were protected from CS-induced mucociliary clearance ( MCC ) disruption . MCC was preserved in mice given the chemical chaperone 4 - phenylbutyric acid , but was disrupted in mice lacking the transcription factor Q16236 , suggesting that oxidative stress and altered proteostasis contribute to the disruption of MCC . Analysis of human

<h2 style="margin: 0">13</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Agents with selective estrogen receptor ( ER ) modulator activity induce apoptosis in vitro and in vivo in ER-negative glioma cells . Tamoxifen , a member of the selective estrogen receptor modulator ( SERM ) family , is widely used in the treatment of estrogen receptor ( ER ) - expressing breast cancer . It has previously been shown that high-dose tamoxifen has cytotoxic activity against glioma cells , but whether this effect is drug specific or represents a general property of SERMs is unknown . In this study , we demonstrate that tamoxifen and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05487

</mark>
 , a novel benzopyranone with SERM activity , induce glioma cell apoptosis in a dose - and time-dependent manner . Moreover , administration of tamoxifen and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 suppresses tumor growth in vivo and extends animal survival in glioma xenograft models . None of the eight glioma cell lines examined express either 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 or - beta , suggesting the mechanism for tamoxifen - and

 - induced glioma cell apoptosis is independent of the ER signaling pathway . Complementary DNA microarray expression profiling allowed us to identify a subset of genes specifically regulated by tamoxifen and

 , and not by other apoptotic stimuli , including nuclear factor ( NF ) - kappaB with its target genes IEX - 3 ,

 ,

 , and

 hinders the refolding of unfolded proteins by increasing the acetylation of heat shock protein 90 . We investigated whether combining

 with the proteasome inhibitor bortezomib would kill cancer cells effectively by inhibiting the degradation of these unfolded proteins , thereby causing ubiquitinated proteins to accumulate and induce ER stress . METHODS : Caki - 1 , ACHN , and 769 - P cells were treated with 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and / or bortezomib . Cell viability , clonogenicity , and induction of apoptosis were evaluated . The in vivo efficacy of the combination was evaluated using a murine subcutaneous xenograft model . The combination-induced ER stress and ubiquitinated protein accumulation were assessed . RESULTS : The combination of 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06603
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>

 and bortezomib induced apoptosis and inhibited renal cancer growth synergistically ( combination indexes &lt; 1 ) . It also suppressed colony formation significantly ( p &lt; 0.05 ) . In a murine subcutaneous tumor model , a 10 - day treatment was well tolerated and inhibited tumor growth significantly ( p &lt; 0.05 ) . Enhanced acetylation of the Q9UBN7 substrate alpha-tubulin was consistent with the suppression of Q9UBN7 activity by 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , and the combination was shown to induce ER stress and ubiquitinated protein accumulation synergistically . CONCLUSIONS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06603

 inhibits renal cancer growth by synergizing with bortezomib to induce ER stress and ubiquitinated protein accumulation . The current study provides a basis for testing the combination in patients with advanced renal cancer .</div>
